import React, { useState, useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";

import { Img, Text, Button } from "components";
import { useNavigate } from "react-router-dom";
import "./LandingPageNavbar.css";

const LandingPageNavbar = (props) => {
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const [windowWidth, setWindowWidth] = useState(window.innerWidth);

  useEffect(() => {
    const handleResize = () => {
      setWindowWidth(window.innerWidth);
    };

    window.addEventListener("resize", handleResize);
    return () => {
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  const isLargeScreen = windowWidth > 767;

  return (
    <>
      <div className={`navbar ${isLargeScreen ? "large" : "small"}`}>
        {isLargeScreen ? (
          <>
            <div className="waffle-logo" onClick={() => navigate("/")}>
              <Img
                src="images/img_image1.png"
                className="logo-image"
                alt="imageOne"
              />
              <Text as="h6" variant="h6">
                {props?.waffle}
              </Text>
            </div>
            <div className="link-product" onClick={() => navigate("/#product")}>
              <Text variant="body3">{props?.product}</Text>
            </div>
            <div className="link-readnews" onClick={() => navigate("/newsfeed")}>
              <Text variant="body3">{props?.readnews}</Text>
            </div>
            <Button
              className="join-waitlist"
              onClick={() => navigate("/waitlist")}
              shape="RoundedBorder10"
              size="md"
              variant="FillOrangeA100"
            >
              {props?.joinWaitlist}
            </Button>
          </>
        ) : (
          <>
            {!isMobileMenuOpen && (
              <FontAwesomeIcon
                icon={faBars}
                className="hamburger"
                onClick={() => setIsMobileMenuOpen(true)}
              />
            )}
            <div className="waffle-logo" onClick={() => navigate("/")}>
              <Img
                src="images/img_image1.png"
                className="logo-image"
                alt="imageOne"
              />
              <Text as="h6" variant="h6">
                {props?.waffle}
              </Text>
            </div>
            {isMobileMenuOpen && (
              <div className="mobile-menu">
                <div className="menu-header">
                  <FontAwesomeIcon
                    icon={faBars}
                    className="hamburger"
                    onClick={() => setIsMobileMenuOpen(false)}
                  />
                  <div className="waffle-logo" onClick={() => navigate("/")}>
                    <Img
                      src="images/img_image1.png"
                      className="logo-image"
                      alt="imageOne"
                    />
                    <Text as="h6" variant="h6">
                      {props?.waffle}
                    </Text>
                  </div>
                </div>
                <div
                  className="link-product"
                  onClick={() => {
                    navigate("/#product");
                    setIsMobileMenuOpen(false);
                    }}
                    >
                    <Text variant="body3">{props?.product}</Text>
                    </div>
                    <div
                    className="link-readnews"
                    onClick={() => {
                    navigate("/newsfeed");
                    setIsMobileMenuOpen(false);
                    }}
                    >
                    <Text variant="body3">{props?.readnews}</Text>
                    </div>
                    <Button
                    className="join-waitlist"
                    onClick={() => {
                    navigate("/waitlist");
                    setIsMobileMenuOpen(false);
                    }}
                    shape="RoundedBorder10"
                    size="md"
                    variant="FillOrangeA100"
                    >
                    {props?.joinWaitlist}
                    </Button>
                    </div>
                    )}
                    </>
                    )}
                    </div>
                    </>
                    );
                    };

LandingPageNavbar.defaultProps = {
waffle: "Waffle.",
product: "Product",
readnews: "Read News",
joinWaitlist: "Join waitlist",
};

export default LandingPageNavbar;
